def get_kth_prime_factor(n, k):
    i = 3
    factors = []
    while i * i <= n:
        if n % i:
            i += 1
        else:
            n //= i
            factors.append(i)
    if n > 1:
        factors.append(n)
    if len(factors) < k:
        return -1
    else:
        return factors[k - 1]

